column2:
@nuclearnerds @ellistheginge I no longer need to worry about staying up on watch, as he never needs to sleep. He is a robot so no need to feed him either. Also ethically I can prioritize my own life above his as he is an AI right?

Also I think I might be able to outrun him just in case.
&lt;3

@KeyboardMonkey3 @rakesh_pulapa Incredible! Grew up in New Mexico so I immediately feel the age old question come up.

Red or Green?

the answer of course being christmas.
